import axios from 'axios';
import {GET_POLLS} from './types';



export const getPolls = ()=>dispatch=>{
    axios
    .get('/api/polls/')
    .then(res => 
        dispatch({
        type:GET_POLLS,
        payload: res.data,
        }))
    .catch(err=>
        dispatch({
            type: GET_POLLS,
            payload: 'No Poles',
        })    
    )

}
